Orders For New York - Leslie Thomas
Unabridged and read by Peter Wickham. 
11 hours 24 mins duration
8 Cassettes
32 kbps / 22 kHz Mono, Fraunhofer CBR )

On a foggy June evening in 1942 a party of Nazi saboteurs landed by submarine in the United States of America. This novel, based on a true sequence of events, concerns a German submarine that came inshore at Long Island, New York disgorging Nazi spies into the city. Within weeks they had been betrayed by their own leader and executed in the electric chair. When war correspondent Michael Findlater retired to Massachusetts to study whales, his ex-wife's powerful husband found a more urgent use for his investigative skills. But as Michael turned up more about the Nazi double betrayer, he realized that someone else still remembered the events of 1942, and that someone wanted him dead!


